INSERT INTO gc.monthly_calendar (id, month_number, year_number, content, insert_datetime) VALUES (3, 3, 2021, '"\n<i>Лунный посевной календарь на <b>Март 2021</b></i> <br />\n\n<div style=\"width:700px;margin-top:25px;border-bottom:black 1px solid;border-right:black 1px solid\">  \n<div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid;font-weight:bold\">Неблагоприятные дни для посадки и пересаживания культур</div> </div> <div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">9,10,13</div>  \n</div>\n\n<br />\n\n<div style=\"width:700px;margin-top:25px;border-bottom:black 1px solid;border-right:black 1px solid\">\t\n<div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid;font-weight:bold\">Культура</div> <div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid;font-weight:bold\">Благоприятные дни для посадки и пересаживания культур</div></div> <div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Базилик, розмарин</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">22,23</div></div>\n<div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Баклажаны, кабачки, патиссоны, тыква</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">22,23</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Дыня</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">22,23</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Клубника, ревень</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">2-4</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Капуста, спаржа </div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">16-18</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\"> Картофель</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">1-5, 29-31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Лук на перо</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">14-15</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Лук на репку</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\"> 2-5, 30-31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Лук порей</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">14-15,19-23</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Морковь</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">1-4,29-31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Перец, томаты</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">22,23</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Подсолнечник, редька</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">22-25</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Редис</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">1-5, 29-31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Салат, шпинат</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">14-18</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Свекла</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">1-4, 11, 12, 29-31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Сельдерей</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">11-13, 16-18</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Укроп, фенхель</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">22-23,  26, 27</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Хмель</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">2-4, 21-23, 30, 31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Хрен</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">2-4, 30, 31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Цикорий</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">2-5, 22, 23, 30, 31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Чеснок</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">2-5, 30, 31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Цветы из луковиц</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">2-4, 30, 31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Цветы из семян</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">22-23, 26-27</div></div>\n</div>\n\n<br />\n\n<i>Лунный посадочный календарь на <b>Март 2021</b></i> <br />\n\n<div style=\"width:700px;margin-top:25px;border-bottom:black 1px solid;border-right:black 1px solid\"> \n\t<div style=\"display:flex;flex-direction:row\">\n\t\t<div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid;font-weight:bold\">Неблагоприятные дни для посадки и пересаживания деревьев и кустарников</div> \n\t</div>\n\t<div style=\"display:flex;flex-direction:row\">\n\t\t<div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">12-14</div>  \n\t</div>\n</div>\n\n<br />\n\n<div style=\"width:700px;margin-top:25px;border-bottom:black 1px solid;border-right:black 1px solid\">  \n\t<div style=\"display:flex;flex-direction:row\">\n\t\t<div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid;font-weight:bold\">Культура</div>\n\t\t<div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid;font-weight:bold\">Благоприятные дни для посадки пересаживания деревьев и кустарников</div>\n\t</div> \n\t<div style=\"display:flex;flex-direction:row\">\n\t\t<div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">Абикос,айва, вишня, слива</div>\n\t\t<div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;border-top:black 1px solid;border-left:black 1px solid\">1, 5, 28, 29</div>\n\t</div>\n\t<div style=\"display:flex;flex-