INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (8, 'Инжировая огневка', '"<h1> Инжировая огневка</h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/io1.jpg\" /> <br />\nВнешний вид вредителя </p>\n\n<i>Синонимы: Cadra figulilella, raisin moth</i>\n\n<hr />\n\n<h2> О вредителе</h2> \n<p>Размеры бабочек при раскрытых своеобразных коричневых крыльев достигают 16–18 мм. Зимует в стадии куколки. Молодые гусеницы (1 и 2 возраста) вначале питаются на нижней стороне листа, соскабливая его мякоть, причем молодые и взрослые гусеницы бывают скрыты паутинным сплетение, под которым они проводят свое развитие. Подросшие гусеницы (3 и 4 возрастов) переходят на верхнюю сторону листа, где продолжают свое развитие до окукливания.  В период своего развития одна гусеница способна повредить 4-5 листьев и кроме того, повреждает плоды, вгрызаясь в их мякоть или соскабливая еще зеленую кожицу. Поврежденные плоды загнивают и опадают. Закончив питание, взрослая гусеница выбирает неповрежденный или мало поврежденные лист, сгибает его край, скрепив место сгиба паутинкой, а внутри сгиба сплетает плотный паутинный кокон белого цвета и в нем окукливается. </p>\n<h2> Вредоносность</h2>\n<p>Является основным вредителем инжира. Сильно повреждает листья и плодоэлементы.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/io2.jpg\" /> <br />\nПовреждение листьев инжировой огневкой</p>\n\n<h2> Географическое распространение </h2>\n<p>Европейская часть России, Кавказ и Закавказье (Армения, Азербайджан), Средняя Азия (Копет-Даг).</p>\n\n<br />"', false, '2021-01-28 11:18:54.498869', 'raisin moth');
INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (7, 'Шерстистая белокрылка', '"<h1> Шерстистая белокрылка </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/shb1.jpg\" /> <br />\nВнешний вид вредителя </p>\n\n<i>Синонимы: Aleurothrixus floccosus, woolly whitefly</i>\n\n<hr />\n\n<h2> О вредителе </h2>\n<p>Обитают, как правило, во влажных тенистых местах, особенно часто встречаются на нижней стороне листьев растений. Личинки всех возрастов питаются клеточным соком растений. На зиму остаются в грунте (под листьями, травой, комками земли) до наступления весны.</p>\n<h2> Вредоносность</h2>\n<p>Белокрылки – полифаги, а потому их обнаружение на растениях само по себе требует принятия ряда профилактических и истребительных мер. Угрозу представляют личинки белокрылок, питающиеся соками растений. Помимо этого, личинки выделяют сахароподобные продукты жизнедеятельности, на которых впоследствии поселяется гриб кладоспориум, приводящий к снижению фотосинтетической способности, вплоть до гибели растения. </p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/shb2.jpg\" /> <br />\nПовреждение листьев </p>\n\n<h2> Географическое распространение </h2>\n<p>Белокрылки – теплолюбивые насекомые, тяготеющие к жаркому влажному климату. В естественных условиях наибольшей численности и видового разнообразия достигают в тропиках и субтропической зоне. Однако в искусственно поддерживаемых условиях парников, теплиц и оранжерей встречаются повсеместно. </p>\n\n<br />"', false, '2021-01-28 07:37:06.412833', 'woolly whitefly');
INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (9, 'Долгоносики', '"<h1> Долгоносики</h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/dg1.jpg\" /> <br />\nВнешний вид вредителя </p>\n\n<i>Синонимы: Otiorhynchus sp., leaf weevils</i>\n\n<hr />\n\n<h2> О вредителе </h2>\n<p>Очень многочисленная и разнообразная группа жуков, насчитывающая 60 тыс. видов, а по некоторым данным количество представителей семейства может достигать 70 тысяч. Свое русское название насекомые получили благодаря удлиненной форме головы, напоминающей хобот слона. В зависимости от длины так называемого «хоботка», долгоносики делятся на короткохоботных и длиннохоботных, которые различаются не только по морфологическому строению, но и по эколого-биологическим особенностям. Многие долгоносики являются вредителями сельского и лесного хозяйства.</p>\n<h2> Вредоносность</h2>\n<p>Связи их с растениями очень разнообразны. Трудно найти вид растения, с которым не были бы связаны виды долгоносиков. Большинство долгоносиков развивается за счёт тканей внутри растений. Реже личинки питаются снаружи частями листа или цветка (*Hyperini, Cionini*). Многие развиваются в почве, питаясь корнями растений, реже — опадом. Немногие питаются гниющей древесиной (*Cossoninae*). Значительное большинство видов связано с травянистой растительностью, большинство с двудольными. Связи с однодольными немного меньше, со споровыми ещё меньше.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/dg2.jpg\" /> <br />\nПовреждение листа долгоносиками </p>\n\n<h2> Географическое распространение </h2>\n<p>Распространены повсеместно, кроме крайнего севера, высокогорных районов и пустынь. Наибольшей численности и видового разнообразия достигают в тропической зоне.</p>\n\n<br />"', false, '2021-01-28 11:28:27.197723', 'leaf weevils');
INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (1, 'Грушевый клоп', '"<h1> Грушевый клоп </h1>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/gklop.jpg\" />\n</p>\n\n<i>Синонимы: Stephanites pyri F., pear lace bug</i>\n\n<hr />\n\n<h2>О вредителе </h2>\n<p>Мелкое насекомое чёрного цвета, длиной 3–5 мм. У взрослого насекомого крупные ажурные крылья, сложенные плоско на спине.\nНасекомое высасывает соки, в результате происходит обесцвечивание, засыхание и опадение листьев, а в связи с этим недоразвитие плодов, ослабление прироста и процесса закладки плодовых почек для урожая будущего года. На повреждённых листьях имеются чёрные пятна, представляющие собой засохшие экскременты клопов. Зимуют взрослые клопы под опавшими листьями, в щелях коры и других защищённых местах. Весной с наступлением тёплых дней они появляются в кронах деревьев и начинают питаться, высасывая соки из листьев.</p>\n<h2> Вредоносность</h2>\n<p>Повреждает главным образом яблоню, затем грушу, айву, иногда косточковые породы.</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/gklop2.png\" /> <br />\nПовреждения листьев яблони,\nнанесённые грушевым клопом: <br />\nА – верхняя сторона листа;\nБ – нижняя сторона листа\n(видны личинки)</p>\n\n<h2> Географическое распространение </h2>\n<p>Распространён в южных районах России, в Абхазии, Крыму, на Кавказе, в Средней Азии, Северной Африке, Европе (в т. ч. в Украине, Молдове).</p>\n<br />"', false, '2020-12-24 13:48:25.08445', 'pear lace bug');
INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (5, 'Филлоксера', '"<h1>Филлоксера</h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/fl1.jpg\" /> <br />\nВнешний вид вредителя </p>\n\n<i>Синонимы: Dactylosphaera vitifoliae, виноградная тля, leaf louse</i>\n\n<hr />\n\n<h2> О вредителе </h2>\n<p>Филлоксера виноградная (виноградная тля) – это мелкое насекомое, размером от 0,25 до 2,25 мм, которое едва различимо невооруженным глазом, имеет желто-зеленый окрас. Тля может размножаться без оплодотворения, благодаря чему быстро распространяется и мигрирует на другие виноградные кусты. Это сосущее насекомое хоботком прокалывает часть растения, где при этом появляется деформированное образование, в котором развиваются личинки. Существует 4 вида этого паразита, каждый из которых имеет свои особенности и повреждает отдельную часть растения: корневая; крылатая; половая; листовая.</p>\n<h2> Вредоносность</h2>\n<p>Филлоксера повреждает все части винограда. На корнях в местах питания образуются вздутия и желваки, развиваются некротические процессы. Результатом может стать полная гибель виноградников, особенно молодых. На листьях образуются галлы, листовые пластинки деформируются и опадают, однако их повреждение не сказывается на качестве продукции и урожайности.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/grape.JPEG\" /> <br />\nПовреждение листьев филлоксерой </p>\n\n<h2> Географическое распространение </h2>\n<p>Ареал распространения филлоксеры охватывает все районы виноградарства в Европе, Азии, Африке, Северной Америке и России.</p>\n\n<br />"', false, '2021-01-28 07:17:51.555559', 'leaf louse');
INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (6, 'Цитрусовая минирующая моль', '"<h1> Цитрусовая минирующая моль</h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/cm1.jpg\" /> <br />\nВнешний вид вредителя </p>\n\n<i>Синонимы: Phyllocnistis citrella</i> Stainton, <i>leaf miner</i>\n\n<hr />\n\n<h2> О вредителе </h2>\n<p>Повреждает листья. Родившиеся гусеницы вгрызаются в лист, прячутся в жилку листа, потом скрыто вредят, выедая лист изнутри, образуя прозрачные мины. При сильном заселении листья деформируются.</p>\n<h2> Вредоносность</h2>\n<p>Повреждает цитрусовые (больше сорта, дающие семена), эвкалипты, ивы, жасмин. Главный источник распространения вредителя – посадочный материал. Период вредоносности – со второй декады августа по ноябрь (в закрытом грунте круглогодично).</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/cm2.jpg\" /> <br />\nПовреждение листьев цитрусовой минирующей молью </p>\n\n<h2> Географическое распространение </h2>\n<p>На сегодняшний день распространена в субтропиках России и Абхазии, вспышки массового размножения цитрусовой минирующей моли наблюдались в регионе в 1999–2002, 2006–2009 гг. Очередной подъём численности был отмечен в 2016–2017 гг., чаще на завозимых из других регионов саженцах.</p>\n\n<br />"', false, '2021-01-28 07:32:25.54562', 'leaf miner');
INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (3, 'Белая цикадка', '"<h1> Белая цикадка </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/gl1.jpg\" /> <br /> \nВнешний вид белой цикадки</p>\n\n<i>Синонимы: Metcalfa pruinosa Say, grape leafhopper</i> \n\n\n<hr />\n\n<h2>О вредителе </h2>\n<p>Взрослые насекомые среднего размера, длина тела до 12 мм. Личинки и имаго питаются клеточным соком листьев, вызывая разрушение хлорофилла. Вместе со слюной идет выделение токсинов. Растения покрываются сладкими выделениями (падью) вредителя и ослабляются. Побеги растений покрываются белым пушистым восковым налетом, среди которого располагаются сначала яйцекладки, а затем белые личинки вредителя. Листья и побеги деформируются, на них образуются желтоватые или беловатые пятна, развивается чернь. </p>\n<h2> Вредоносность</h2>\n<p>Повреждает 330 видов растений из 78 семейств. При поражении плодовых может спровоцировать опадение незрелых плодов, а при сильной степени повреждения плоды могут вообще не образоваться.</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/gk2.jpg\" /> <br />\nПовреждение листа винограда белой цикадкой</p>\n\n<h2> Географическое распространение</h2> \n<p>В настоящее время встречается на побережье и в равнинной части Краснодарского края повсеместно. В 2015–2016 гг. во влажных субтропиках России и Абхазии отмечена вспышка массового размножения. Естественный ареал охватывает Канаду, США, Бермуды.</p>\n\n<br />\n\n\n\n"', false, '2021-01-12 11:57:17.612969', 'grape leafhopper');
INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (10, 'Парша', '"<h1> Парша </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/parch.png\" />\n</p>\n\n<i>Синонимы: scab</i>\n\n<i>Возбудитель:</i> на яблоне <i>Venturia inaequalis</i> (Cooke) G. Winter\n, <i>Fusicladium dendriticum</i> (Wallr.) Fuckel  <br />                                                                                                                                                                                                                                                                                                                                                                                                                             \n\n<hr />\n\n<h2> О болезни </h2>\n<p>Возбудители болезни – грибы, которые строго приурочены к растениям-хозяевам. Парша яблони не может заразить грушу и наоборот. На плодах появляются небольшие чёрные или серо-чёрные пятна. При большом распространении болезни рост плодов прекращается, на них появляются трещины. На листьях образуются бурые пятна с бархатистым налётом, которые постепенно разрастаются. При сильном поражении листья опадают. На побегах кора тоже растрескивается, шелушится, образуются язвочки. Такие побеги нередко отмирают. Развитию заболевания способствуют влажная прохладная погода, обильная роса и дожди. Чаще болеют густо посаженные и старые, ослабленные деревья. Наиболее восприимчивы к парше листья в первые 25 дней роста. </p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/yab_parch.jpg\" /> <br /> Плод яблони, поврежденный паршой\n</p>\n<h2> Вредоносность</h2>\n<p> Опасное грибное заболевание яблони. Болезнь поражает листья, плоды, цветки и побеги. Возбудитель болезни зимует главным образом на пораженных опавших листьях.</p>\n\n<h2> Географическое распространение</h2>\n <p>Повсеместно распространённое заболевание.</p>\n<br />"', false, '2021-03-11 10:56:30.122868', 'scab');
INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (2, 'Бурая пятнистость', '"<h1> Бурая пятнистость листьев яблони </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/bapple.jpg\" />\n</p>\n\n<i>Синонимы: филлостиктоз, brown leaf spot</i>\n\n<i>Возбудитель:</i> <i>Mycosphaerella pomi (Pass.) Lindau</i>\n\n<hr />\n\n<h2> О болезни </h2>\n<p>Заражение различных органов яблони может происходить в течение всего вегетационного сезона. На поражённых листьях появляются коричнево-бурые пятна округлой, овальной или угловатой неправильной формы, диаметром до 5 мм, иногда крупнее. В центре пятно светлее, по краям – темнее. Развитию заболевания способствуют повышенная влажность и загущенные насаждения. </p>\n\n<h2> Вредоносность</h2>\n<p>Заболевание вызывает преждевременное пожелтение и опадение листьев. В период максимального развития заболевания отмечается резкий спад интенсивности фотосинтеза больных растений.</p>\n\n<h2> Географическое распространение</h2>\n <p>Заболевание распространено в России (Чернозёмная зона, Кавказ), Абхазии, Европе (в т. ч. Молдове, Украине).</p>\n<br />"', false, '2021-01-12 11:57:02.399885', 'brown leaf spot');
INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (11, 'Трипс', '"<h1>Трипс </h1>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/thr_1.jpg\" />\n</p>\n\n<i>Синонимы: Heliothrips haemorrhoidalis Bouché, thrips</i>\n\n<hr />\n\n<h2>О вредителе </h2>\n<p>Тело самки узкое, тёмно-коричневое, ноги и последние три сегмента брюшка бледно-жёлтые. Длина тела самки 1,2–1,5 мм. Зимует в фазе яйца. Появление личинок отмечается в конце апре-\nля – начале мая, далее, до холодного периода трипс дает до 4 поколений.</p>\n<h2> Вредоносность</h2>\n<p>Повреждает широкий спектр растений:цитрусовые, плодовые, декоративные и технические культуры. Питается на цветках, листьях, побегах и плодах, высасывая соки. Листья и плоды в местах повреждений приобретают бледно-жёлтую окраску, а их поверхность загрязнена буро-коричневыми экскрементами трипса.</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/thr.jpg\" /> <br /> Повреждение листа лавра трипсом\n</p>\n\n<h2> Географическое распространение </h2>\n<p>Распространён в странах с субтропическим климатом.</p>\n<br />"', false, '2021-03-11 10:57:31.948262', 'thrips');
INSERT INTO pp.disease (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (12, 'Ржавчина яблони и груши', '"<h1> Ржавчина яблони и груши</h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/rga.jpg\" />\n</p>\n\n<i>Синонимы: rust</i>\n\n<i>Возбудитель:</i> <i>Ochropsora ariae</i> (Fuckel) Ramsb.\n\n<hr />\n\n<h2> О болезни </h2>\n<p>Возбудитель ржавчины яблони – разнохозяинный вид(т. е. их жизненный цикл проходит со сменой растения-хозяина)..\nПервые стадии развиваются на представителях семейства Лютиковые, дальнейшие стадии развиваются на яблоне. Проявляется вскоре после цветения и достигает наибольшего развития в середине лета.  На верхней стороне листьев вначале появляются округлые оранжевые или красноватые (как бы ржавые) пятна, постепенно увеличивающиеся в размере.. </p>\n\n<h2> Вредоносность</h2>\n<p>Считается, что серьёзного ущерба урожаю болезнь не наносит.</p>\n\n<h2> Географическое распространение</h2>\n <p>Заболевание широко распространено в России и Абхазии, а также в Азии (Китай, Япония, Непал, Тайвань, Таиланд) и Европе (Болгария, Дания, Германия, Греция, Скандинавия, Польша, Турция, Англия).</p>\n<br />"', false, '2021-03-12 09:39:01.815751', 'rust');
