INSERT INTO heal (id, name, content, is_deleted, insert_datetime) VALUES (6, 'Меры борьбы с паршой яблони', '"<h1>Меры борьбы с паршой яблони</h1>\n<h2>Агротехнический метод.</h2>\n Регулярный сбор и уничтожение поражённых плодов, опавших листьев. Перекопка почвы в междурядьях и приствольных кругов. Весенняя вырезка поражённых побегов со сморщенной, растрескивающейся корой. Предохранение плодов от механических повреждений при сборе урожая и отбраковка больных перед закладкой на хранение. Систематическая борьба с вредителями и болезнями, наносящими ранки, через которые проникают возбудители плодовых гнилей.\n\n<h2>Биологический метод.</h2> \nВ связи с тем, что обработка растений в момент созревания плодов не допустима, имеет смысл\nиспользования фитоактиватора биологического происхождения Альбит, ТПС в концентрации 1,5 мл на 10 л (действующее вещество поли-бета-гидроксимаслянная кислота), применение которого даже через полтора месяца после прекращения обработок сдерживает развитие возбудителей монилиоза\n\n<h2>Химический метод</h2>\nОсновное внимание должно быть уделено предохранению деревьев от первичного заражения аскоспорами и сдерживанию распространения болезни в летнее время. В садах, сильно пораженных паршой, рано весной, до распускания почек, деревья и почву обильно опрыскивают препаратами, уничтожающими споры парши. Для этого применяют ДНОК или нитрафен,\nжелезный купорос или медный купорос, или же олеокуприт.\n\nВ течение вегетации для борьбы с паршой применяют бордоскую жидкость и препараты, объе-\nдиненные общим названием „заменители бордоской жидкости\": хлорокись меди, цинеб, каптан,\nфталан и др. В начале распускания почек (фаза „зеленого конуса“) деревья опрыскивают 3-4%-\nной бордоской жидкостью или в фазу выдвигания — обособления бутонов — применяют 1%-ную\nбордоскую жидкость.\n\nВторое опрыскивание проводят сразу после цветения одним из следующих фунгицидов: 1%-\nной бордоской жидкостью, суспензиями цинеба, хлорокиси меди, каптана, фталана, купрозана\n(хомицина) и др. Третий раз деревья опрыскивают обычно суспензиями цинеба, каптана или фта-\nлана через 15-20 дней после цветения одновременно с опрыскиванием против яблонной плодожорки. Следует учитывать, что бордоская жидкость и хлорокись меди при летнем опрыскивании\nмогут вызывать сетку на плодах и ожог листьев. Эти препараты следует проверять на ожигаемость. За пять дней до обработки деревьев проводят опрыскивание отдельных веток всех сортов\nяблони, намеченных для обработки. Ожоги обычно проявляются в виде пятен отмирающей ткани\nна листьях, или образовании сетки на плодах.\n\nДля борьбы с паршой яблони можно применять также байлетон, поликарбацин, полихом, серу\nколлоидную, сероцин, топсин-М, эупарен и др. Сроки последних обработок не позднее 20 дней\nдо уборки урожая. Кратность обработки от 4 до 6 по согласованию с местными сельско-\nхозяйственными учреждениями."', false, '2021-03-12 07:26:51.91939');
INSERT INTO heal (id, name, content, is_deleted, insert_datetime) VALUES (1, 'Меры борьбы с болезнями листьев', '"<h1> Меры борьбы с болезнями листьев</h1>\n<h2> Агротехнический метод</h2>\n<p>Сбор и уничтожение опавших поражённых листьев (компостирование или сжигание) – основного источника возбудителей болезней. Подкормка растений минеральными удобрениями. Уход за кроной.</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/komp.jpg\" /> <br />\nКомпостирование опавших листьев</p>\n\n<h2> Химический метод</h2> \n<p>Против пятнистостей – опрыскивание бордоской смесью, ВРП (1%-ный) или её заменителями, например, Абига-Пик, ВС (50 г на 10 л воды). Вторая обработка – после цветения препаратом Скор, КЭ (2 мл на 10 л воды), Строби, ВДГ (2 мг на 10 л воды) или Хорус, ВДГ (2 г на 10 л воды). В дальнейшем, при необходимости, обработки можно повторять с интервалом 14 дней. <br />\nХорошие результаты при борьбе с чернью дают и регулярные опрыскивания насаждений бордоской смесью, ВРП (1%-ный) или её заменителями, например, Абига-Пик, ВС (50 г на 10 л воды), а также препаратом Строби, ВДГ (2 мг на 10 л воды).</p>\n\n<br />"', false, '2020-12-24 13:48:45.106784');
INSERT INTO heal (id, name, content, is_deleted, insert_datetime) VALUES (2, 'Меры борьбы с листогрызущими вредителями', '"<h1> Меры борьбы с листогрызущими вредителями </h1>\n\n<h2> Агротехнический метод</h2> \n<p>\n<li>Очистка деревьев от старой коры, уборка опавших листьев и растительных остатков, осенняя перекопка почвы под кроной деревьев. Сбор и сжигание гнезд с гусеницами американской белой бабочки. <br />\n</li><li>Вырезка и сжигание побегов, сильно заселённых цитрусовой минирующей молью.\n</li><li> В борьбе с кукурузным мотыльком на территории плантаций и в окрестностях необходимо проводить своевременное удаление всех повреждённых мотыльком стеблей кукурузы. </li></p>\n<br />\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/gb.jpg\" /> <br />\nГнездо американской белой бабочки </p>\n\n<li> Для сбора жуков японского опалового хруща эффективно использовать светоловушки. \n</li><li>Против слизней и улиток: скашивание травы, ручной сбор моллюсков, внесение минеральных удобрений (суперфосфат 100–120 кг/га), свежегашёной извести и золы вокруг растений.\n\n<h2> Биологический метод </h2>\n<p>Против гусениц первых возрастов американской белой бабочки, листовёрток, кукурузного мотылька, фруктовой полосатой моли можно использовать бактериальный препарат Лепидоцид СК, представляющий собой спорово-кристаллический комплекс бактерии <i>Bacillus thuringiensis</i> var. kurstaki (20–30 мл препарата на 10 л воды). Срок ожидания пять дней, что позволяет производить обработку незадолго до сбора урожая. Не накапливается в растениях, в том числе в плодах.</p>\n\n<h2> Химический метод</h2>\n<p>\n</p></li><li> Весной, до роста новых листьев, растения обрабатывают Препаратом 30 Плюс, ММЭ в 2,5–3,0%-ной концентрации (250–300 мл препарата на 10 л воды). <br />\n</li><li> В течение вегетации после цветения (летний период) применяются инсектициды Децис Профи, ВДГ (0,5 г на 10 л воды), Каратэ Зеон, МКС (4 мл на 10 л воды), Искра Золотая, КЭ (5 мл на 10 л воды), а также гормональный препарат, регулирующий рост и развитие личинок, Димилин, ВДГ (3–6 г на 10 л воды).<br />\n</li><li> Перспективными инсектицидами в борьбе с цитрусовой минирующей молью являются препараты Децис Профи, ВДГ (0,5 г на 10 л воды), Каратэ Зеон, МКС (4 мл на 10 л воды), Фитоверм 1%-ный, КЭ (3–4 мл на 10 л воды) действие которых наиболее интенсивно сказывается на 10-й и последующие дни (биологическая эффективность– 94–96 %). Препарат Фитоверм, КЭ в смеси с Препаратом 30 Плюс, ММЭ эффективен уже на 4-й день. Обработка должна быть проведена по гусеницам младших возрастов, т. е. в самом начале появления новых мин. <br />\n</li><li> Против саранчовых эффективен препарат Кунгфу, КЭ (2 мл на 10 л воды), Димилин, СП (3–6 г на 10 л воды), Децис Профи, ВДГ (0,5 мл на 10 л воды).<br />\n</li><li> Эффективным в борьбе с голыми слизнями и улитками является только применение препаратов на основе метальдегида (Гроза, Г – 30 г на 10 м2) путём разбрасывания на поверхности почвы вокруг растений. Препараты представляют собой отравленную приманку, изготовленную из отрубей грубого помола. Токсичность сохраняется более двух недель. Растения не обжигает и не угнетает.\n</li>\n<p></p>\n<br />"', false, '2021-01-12 11:58:44.229712');
INSERT INTO heal (id, name, content, is_deleted, insert_datetime) VALUES (3, 'Меры борьбы с сосущими вредителями', '"<h1> Меры борьбы с сосущими вредителями</h1>\n\n<h2>Агротехнический метод </h2>\n<p>Санитарная обрезка крон, вырезка повреждённых ветвей и побегов, вырубка усохших деревьев. Сбор заселённой вредителями опавшей листвы и плодов. Все отходы выносятся за пределы сада и сжигаются до начала вегетации.</p>\n<h2> Биологический метод </h2>\n<p>\n</p><ul>\n<li>Против сосущих насекомых, особенно против тлей, листоблошек, клещей можно использовать таких хищных насекомых как кокцинеллиды, или божьи коровки, относящихся к родам <i>Lindorus, Rodolia, Chilocorus</i>. <br />\n</li><li> Против щитовок можно использовать такого паразита как энкарзия – <i>Encarsia perniciosi</i>Tow. (ранее был известен как проспальтелла <i>Prospaltella perniciosi</i> Tow., <i>Hymenoptera: Aphelinidae</i>). Этот вид является узкоспециализированным паразитом тутовой и калифорнийской щитовок, развивая за одно поколение щитовок два своих.<br />\n</li><li> Против кровяной тли используют афелинуса – <i>Aphelinus mali</i> Haid. (<i>Hymenoptera : Aphelinidae</i>). Хорошие результаты даёт применение хищного жука криптолемуса – <i>Cryptolaemus montrouzieri</i> Mulsant. <br />\n</li><li>Высокой эффективностью в борьбе с клещами, тлёй и червецами обладает бактериальный препарат Битокси-бациллин, П, который представляет собой споровый порошок <i>Bacillus thuringiensis</i> var. thuringiensis. Применяется при температуре воздуха не ниже +15 оС и влажности 70–80 % в концентрации 100 г препарата на 10 л воды с интервалом 7–10 дней. <br />\n</li><li>Есть мнение, что против личинок и имаго мраморного клопа эффективны грибные штаммы Beauveria bassiana.\n</li></ul>\n<p></p>\n\n<table>\n<tr> <th>\n<p>\n <img src=\"https://portal.leafs.pro/web_images/erkar.jpg\" /> </p></th><th> <p> <img src=\"https://portal.leafs.pro/web_images/afel.jpg\" /> </p> </th></tr> <tr><td>Энкарзия –  <i>Encarsia perniciosi </i>Tow.</td> <td>Афелинус – <i>Aphelinus mali</i> Haid. </td> </tr>\n</table>\n\n<h2> Химический метод </h2>\n<p>\n</p><ul>\nВ зимний период высокой эффективностью против зимующих стадий всех сосущих вредителей отличается Препарат 30 Плюс, ММЭ, в концентрации в безлистный период до 5 % (500 мл на 10 л воды).<br />\nВ весенний период препарат может быть использован в баковых смесях с инсектоакарицидами нового поколения (Фастак, КЭ – 2–3 мл на 10 л воды, Децис Профи, ВДГ – 0,5 г на 10 л воды, , Би-58 новый, КЭ – 15 мл на 10 л воды, Фуфанон, КЭ – 10 мл на 10 л воды), но в более низкой концентрации – 1 % (т. е. только 100 мл на 10 л воды).<br />\nДля установления сроков химической обработки против калифорнийской щитовки проводится развешивание феромонных ловушек (1 шт./га), и при появлении в них первых особей самцов проводятся обработки вышеуказанными препаратами с интервалом 31–35 дней.\n<br />Высокие результаты в борьбе с большинством сосущих вредителей на плодовых культурах показывает Фитоверм, КЭ, который выпускается в нескольких препаративных формах, отличающихся содержанием действующего вещества: 2 г/л; 10 г/л; 50 г/л (в стадии регистрации); Фитоверм-М, 2 г/л отличается от них наличием прилипателя. Наиболее предпочтительной формой для промышленных садов в плане экономии транспортных расходов и технологии применения является Фитоверм, КЭ с содержанием д.в. 10 г/л и 50 г/л и Фитоверм-М, КЭ. В личных садах удобнее использовать Фитоверм с содержанием д.в. 2 г/л. Концентрация рабочего раствора подбирается согласно инструкции к препарату. Для Фитоверм 1 %, КЭ концентрация рабочего раствора – 3–4 мл препарата н 10 л воды. Расход рабочей жидкости – до 5 л на дерево. Фитоверм обладает высокой эффективностью практически против всех видов тлей, но только при применении его в начале заселения ими растений – до цветения, пока они ещё открыто живут, и не успели вызвать деформации листьев, после чего в скрученных листьях становятся плохо доступными для препарата. <br />\nПротив клещей можно использовать препарат Кумулус ДФ, ВДГ, действующим веществом которого является коллоидная сера. Концентрация рабочего раствора 40–80 г препарата на 10 л воды. Препарат используется в диапазоне температур от +18 оС до +28 оС. Кумулус нельзя применять в периоды жары и засухи. В летний период, когда нельзя использовать Кумулус, против клещей применяют акарициды Омайт, ВЭ (20 мл на 10 л воды), Демитан, СК (3 мл на 10 л воды) и Фитоверм 1%, КЭ (3–4 мл на 10 л воды).<br />\nПротив мраморного клопа единственным эффективным способом борьбы является химический. По данным, опубликованным зарубежными исследователями , эффективными в борьбе с имаго клопа зарекомендовали себя препараты пиретроидной и неникотиноидной групп. <p></p>\n<br />\n<table> \n<colgroup> <col span=\"4\" style=\"background-color:#0541\"></col>\n</colgroup>  \n<caption><b><i>Рекомендованные препараты и их концентрация при борьбе с мраморным клопом</i></b></caption>\n<tr><th>Кратность обработки </th><th>Название препаратов</th><th>Действующее вещество</th><th>Концентрация рабочего раствора</th></tr><tr><td>Двукратная</td><td>Талстар, КЭ или Клипер, КЭ </td><td>бифентрин</td><td>6 мл на 10 л воды</td></tr><tr><td>Однократная</td><td> Конфидор экстра, ВДГ</td><td>Имидаклоприд</td><td>1,5 г на 10 л воды</td></tr><tr><td>Однократная</td><td>Снейк, РП или Гринда, РП</td><td>Ацетамиприд</td><td>1,5 г на 10 л воды</td></tr><tr><td>Однократная</td><td>Каратэ Зеон, МКС</td><td>Лямбда-цигалотрин</td><td>4 мл на 10 л воды</td></tr>  \n</table>\n\n\n<br /> <i> Следует помнить, что основной «удар» по вредителю следует наносить в весенний период, когда развивается его первое поколение. Тем самым есть возможность сократить численность первого поколения, что закономерно приведет к снижению численности и последующих поколений, а, следовательно, сократит затраты на защитные мероприятия. При этом есть данные, что инсектициды эффективнее действуют на перезимовавших взрослых клопов, чем на имаго 1–2 поколения.</i>\n</ul>"', false, '2021-01-12 11:59:04.180204');
INSERT INTO heal (id, name, content, is_deleted, insert_datetime) VALUES (5, 'Меры борьбы с филлоксерой', '"<h1>Меры борьбы с филлоксерой винограда</h1>\n\n<h2>Агротехнический метод</h2>\n\n<p>Обнаруженные очаги заражения стоит незамедлительно ликвидировать. При обнаружении вредителя нужно удалить больные растения, сжечь фрагменты виноградника, пораженные тлей. Сажать на их месте новые саженцы нельзя в течение 5 лет.</p>\n\n<h2> Химический метод</h2>\n<p>\nПри массовом поражении обработку производят химическими препаратами трижды:<br />\n•\tВ первой декаде мая, когда появились 1-2 листа.<br />\n•\tВ третьей декаде мая, после появления больше 10 листов.<br />\n•\tВ конце июня, когда куст полностью покроется зеленью.<br />\nПротив листовой формы тли эффективны такие препараты как: Митак, Маршал, Золон, Актеллик.\n</p>"', false, '2021-02-01 12:59:02.003276');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (2, 'Лавр', '{"blocks": [{"key": "cbju0", "data": {}, "text": "Цветение. Лавр растят в качестве декоративно-лиственного растения.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 66, "offset": 0}, {"style": "fontsize-14.86", "length": 66, "offset": 0}, {"style": "BOLD", "length": 8, "offset": 0}]}, {"key": "9mm3j", "data": {}, "text": "Освещенность. Нуждается в большом количестве яркого света.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 58, "offset": 0}, {"style": "fontsize-14.86", "length": 58, "offset": 0}, {"style": "BOLD", "length": 12, "offset": 0}]}, {"key": "3ggl3", "data": {}, "text": "Температурный режим. На протяжении весенне–летнего периода ― от 20 до 26 градусов, а осенью ― от 12 до 15 градусов.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 115, "offset": 0}, {"style": "fontsize-14.86", "length": 115, "offset": 0}, {"style": "BOLD", "length": 19, "offset": 0}]}, {"key": "9ko41", "data": {}, "text": "Полив. На протяжении вегетационного периода поливать надо обильно и систематически, делают это сразу же просыхания верхнего слоя почвосмеси в горшке. В знойные дни полив проводят дважды в сутки. С наступлением осени проводят сокращение полива, при этом в зимнее время он должен быть редким и скудным, но допускать пересушки кома земли в горшке нельзя.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 351, "offset": 0}, {"style": "fontsize-14.86", "length": 351, "offset": 0}, {"style": "BOLD", "length": 5, "offset": 0}]}, {"key": "2imc3", "data": {}, "text": "Влажность воздуха. Она должна быть повышенной. В жару куст систематически увлажняют из пульверизатора, а в поддон всыпают влажный керамзит.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 139, "offset": 0}, {"style": "fontsize-14.86", "length": 139, "offset": 0}, {"style": "BOLD", "length": 17, "offset": 0}]}, {"key": "10jra", "data": {}, "text": "Удобрение. На протяжении вегетационного периода подкормки проводят раз в 4 недели, используя для этого минеральное комплексное удобрение. В зимнее время удобрение в почвосмесь не вносят.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 186, "offset": 0}, {"style": "fontsize-14.86", "length": 186, "offset": 0}, {"style": "BOLD", "length": 9, "offset": 0}]}, {"key": "fca7u", "data": {}, "text": "Период покоя. Наблюдается в октябре–марте.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 42, "offset": 0}, {"style": "fontsize-14.86", "length": 42, "offset": 0}, {"style": "BOLD", "length": 12, "offset": 0}]}, {"key": "d14d1", "data": {}, "text": "Пересадка. Молоденькие кусты пересаживают 1 раз в пару лет, а взрослые ― 1 раз в 3 либо 4 года.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 95, "offset": 0}, {"style": "fontsize-14.86", "length": 95, "offset": 0}, {"style": "BOLD", "length": 9, "offset": 0}]}, {"key": "eue3h", "data": {}, "text": "Почвосмесь. В ее состав должен входить песок, торф, дерновая, перегнойная и листовая почва (1:1:1:2:2).", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 103, "offset": 0}, {"style": "fontsize-14.86", "length": 103, "offset": 0}, {"style": "BOLD", "length": 10, "offset": 0}]}, {"key": "7u05r", "data": {}, "text": "Обрезка. Обрезают куст в середине августа.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 42, "offset": 0}, {"style": "fontsize-14.86", "length": 42, "offset": 0}, {"style": "BOLD", "length": 7, "offset": 0}]}, {"key": "bq8ec", "data": {}, "text": "Размножение. Черенкованием и семенным способом.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 47, "offset": 0}, {"style": "fontsize-14.86", "length": 47, "offset": 0}, {"style": "BOLD", "length": 11, "offset": 0}]}, {"key": "c05lf", "data": {}, "text": "Вредные насекомые. Щитовки, паутинные клещи и мучнистые червецы.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 64, "offset": 0}, {"style": "fontsize-14.86", "length": 64, "offset": 0}, {"style": "BOLD", "length": 17, "offset": 0}]}, {"key": "9bl80", "data": {}, "text": "Заболевания. Сажистый гриб.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 27, "offset": 0}, {"style": "fontsize-14.86", "length": 27, "offset": 0}, {"style": "BOLD", "length": 11, "offset": 0}]}, {"key": "1dsgj", "data": {}, "text": "Свойства. Лавр отличается лечебными свойствами, а еще его широко используют в качестве пряности.", "type": "ordered-list-item", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(73,73,73)", "length": 96, "offset": 0}, {"style": "fontsize-14.86", "length": 96, "offset": 0}, {"style": "BOLD", "length": 8, "offset": 0}]}], "entityMap": {}}', true, '2020-12-30 17:35:47.45035', NULL);
