INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (4, 'Мушмула', '"<h1> Мушмула </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/loquat1.jpg\" />\n</p>\n\n<i>Латинское название:</i>  <code><i>Eriobotrya</i></code> <br />\n<i>Английское название:</i>  <code><i>Loquat</i></code>\n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение </p>\n<p><i>Употребление в пищу:</i>  плоды съедобны</p>\n\n<h2> Описание </h2>\n<p>Небольшое вечнозелёное дерево или кустарник. При благоприятных условиях может превратиться в крупное дерево высотой до 10—12 метров и более. Ширина кроны при этом примерно соответствует её высоте. Размножается семенами (плодоношение в таком случае начинается 4—8 годы), также черенками, методом подвоя на грушу и др. Всхожесть семян почти 100%, но важно не допускать их усыхания более чем на три дня. Дерево успешно размножается самосевом. Взрослое растение весной образует грушевидные съедобные плоды, которые обычно собраны в кисти по одному-восемь. Урожаи обильны и, при условии мягкой зимы, ежегодны.</p>  \n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/loquat2.jpeg\" /> <br />\n  Плодоносящая мушмула\n</p>\n\n\n<h2> Географическое распространение </h2>\n<p>Родина — влажные субтропики Китая и Японии, где растёт, как правило, на горных склонах. Выращивать в России дерево начали в XIX веке. Сегодня полезное растение ценят на Кавказе, Украине, в США, Иране, Японии, Абхазии, Израиле, Южной Европе (Италия, Испания).</p>\n\n<h2>Значение и применение</h2>\n<p>Первоначально мушмула японская выращивалась как декоративное растение, в настоящее время культивируется как плодовое. Косточки мушмулы традиционно используются в Италии для настоя алкогольных напитков, которым они придают вкус вишнёвого ликёра. Также ими начиняют тушки птиц перед запеканием в духовке для придания мясу птицы аромата фруктов.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/loquat3.jpg\" /> <br />\n  Цветущая мушмула \n</p>\n\n<h2> Чем полезно </h2>\n<p>Ценность фрукта обусловлена его составом. Он включает необходимые человеку, полезные нутриенты:</p>\n<ul>\n<li>набор витаминов группы В: 1, 2, 3, 6, 9 плюс А, С, Е, К;\n</li><li>микроэлементы: калий, кальций, йод, железо, селен, натрий, магний, медь;\n</li><li>каротин, бета-каротин;\n</li><li>клетчатка;\n</li><li>дубильные вещества;\n</li><li>пектины, яблочная, лимонная кислоты;\n</li><li>фитонциды;\n</li><li>природные сахара (фруктоза, сахароза).\n</li></ul>\n<br />"', false, '2021-01-12 11:55:30.064432', 'loquat');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (15, 'Инжир', '"<h1> Инжир </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/ing1.jpg\" />\n</p>\n\n<i>Латинское название:</i> <code>     <i>Ficus</i></code> <br />\n<i>Английское название:</i> <code>    <i>Figs</i></code>\n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение </p>\n<p><i>Употребление в пищу:</i> плоды съедобны</p>\n\n<h2> Описание </h2>\n<p>Инжир — многолетнее субтропическое дерево(до 10 метров) или ветвистый кустарник(6-8 метров). Продолжительность жизни инжира составляет 30-100 лет. Плодоношение начинается в 2-3 года.</p>\n\n\n<h2> Географическое распространение </h2>\n<p>В дикой природе инжир широко распространен в странах Средиземноморья, в Малой Азии, Индии, Афганистане. Инжировые плантации размещены в Турции, Греции, Италии, Тунисе, Португалии, на американском континенте.В России  инжир растет в Краснодарском крае на побережье Черного моря. Также есть  сорта, которые выращивают в южных регионах европейской части страны.</p> \n\n<h2> Значение и применение </h2>\n<p>Инжир употребляют в свежем, сушёном и консервированном виде. Из свежих плодов варят варенье и джем.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/ing2.jpg\" /> <br />\n  Сушенные плоды инжира\n</p>\n\n<h2> Чем полезно </h2>\n<p>Инжир является органическим источником витаминов группы B: B1, B2, B12 и многих других полезных веществ, таких как калий, магний и железо.</p> \n\n<br />"', false, '2021-01-29 07:45:30.915035', 'figs');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (8, 'Фейхоа', '"<h1> Фейхоа </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/feijoa1.jpg\" />\n</p>\n\n<i>Латинское название:</i> <code><i>Feijoa</i></code> <br />\n<i>Английское название:</i> <code><i>Feijoa</i></code> <br />\n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение</p>\n<p><i>Употребление в пищу:</i> плоды съедобны </p> \n \n<h2> Описание </h2>\n<p>Фейхоа -  вечнозелёные кустарники или невысокие деревья высотой до 4 м. Цветет весной или летом. Продолжительность жизни зависит от температурного режима, полива, освещения. Клонированное (привитое, укоренённое) фейхоа начинает плодоносить на третьем — четвёртом году, сеянцы — с 6—7-летнего возраста. </p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/feijoa2.jpe\" /> <br />\n  Цветение фейхоа\n</p>\n\n\n<h2> Географическое распространение </h2>\n<p>Типичное субтропическое растение. В настоящее время произрастает в заповедных местах субтропической части Кавказа, на юге России — в Краснодарском крае, Дагестане, а также в Крыму, Армении, Абхазии, Грузии, Туркмении, Азербайджане, Австралии, Новой Зеландии, США, Франции, Италии, в Греции, Испании и Португалии.</p> \n\n<h2> Значение и применение </h2>\n<p>Плоды фейхоа используют в кулинарии, приготавливая компоты, лимонады, пюре и салаты. </p> \n\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/feijoa3.jpg\" /> <br />\n  Варенье из фейхоа\n</p>\n\n<h2> Чем полезно </h2>\n<p>Плоды богаты сахарами, органическими кислотами, йодом.</p> \n\n<br />"', false, '2021-01-27 12:12:37.053552', 'feijoa');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (9, 'Тeст', '"тест 1\nsrc=«/web_images/test.jpg»\n\nтест 2\nsrc=«web_images/test.jpg»\n\nтест 3\n<p align=\"center\"> <img src=\"web_images/test.jpg\" /> </p>\n\nтест 4 \nsrc=«https://cdn.sm-news.ru/wp-content/uploads/2020/09/02/k5nwphq.jpg»"', true, '2021-01-27 13:06:35.60659', NULL);
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (11, 'тест', '"тест \n\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/peach1.jpg\" />\n</p>"', true, '2021-01-28 06:40:31.815199', NULL);
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (12, 'Лавр', '"<h1> Лавр </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/lau2.jpg\" />\n</p>\n\n<i>Латинское название:</i><i><code>Laurus</code></i> <br />\n<i>Английское название:</i><i><code>Laurel</code></i>\n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение </p>\n<p><i>Употребление в пищу:</i> используется как пряность</p>\n\n<h2> Описание </h2>\n<p>Лавр представляет собой вечнозелёное дерево или высокий кустарник, достигающий 10—15 м в высоту. Продолжительность его жизни от 100 до 400 лет. Размножается лавр семенным способом и черенкованием. Цветет лавр весной, с марта по апрель. </p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/lau.jpg\" /> <br />\n  Цветущий лавр\n</p>\n\n\n<h2> Географическое распространение </h2>\n<p>Родиной лавра считается Закавказье и Малая Азия. На территории России произрастает в юго-западных районах Краснодарского края. Широко культивируется в субтропиках обоих полушарий.</p>\n\n<h2> Значение и применение </h2>\n<p>Лавр в первую очередь считают растением-специей. Практически все части дерева используют для этой цели: листья в свежем и сушеном виде, свежие плоды, семена, порошок из листьев и лавровое масло.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/lau3.jpg\" /> <br />\n  Пряность - лавровый лист\n</p>\n\n\n<br />"', false, '2021-01-28 11:55:45.583515', 'laurel');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (13, 'Груша', '"<h1> Груша </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/pear1.jpg\" />\n</p>\n\n<i>Латинское название:</i> <i><code>Pyrus</code></i> <br />\n<i>Английское название:</i> <i><code>Pear</code></i>\n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение </p>\n<p><i>Употребление в пищу:</i> плоды съедобны</p>\n\n<h2> Описание</h2>\n<p>Груша представляет собой дерево высотой до 20 м, иногда крупный кустарник. Цвести начинает с появлением листьев в мае. Размножается отводками, черенкованием и прививкой, намного реже – семенами. Живут груши в среднем 150-200 лет. Сроки начала плодоношения зависят от сорта груши и варьируются от 3 до 15 лет после посадки. </p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/pear2.jpg\" /> <br />\n  Цветущая груша\n</p>\n\n\n<h2>  Географическое распространение </h2>\n<p>В диком виде груша произрастает в теплом поясе Евразии, а также в районах с умеренным климатом. Благодаря усилиям селекционеров грушу можно выращивать и в более прохладных регионах - на Урале и Сибири.</p>\n\n<h2>  Значение и применение </h2>\n<p>Плоды груши используют в пищу как в свежем, так и в различных вариантах приготовления. Лучшие по качеству плоды груш можно использовать на варенье, повидло, пастилу. Поджаренные семена на Кавказе использовали для приготовления суррогата кофе. Древесина имеет красивый рисунок и цвет, идёт на различные столярные и токарные изделия.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/pear3.jpg\" /><br />\n  Варенье из груши\n</p>\n\n<h2> Чем полезно </h2>\n<p>Груши очень полезны для здоровья, так как содержат большое количество витаминов (группы A, B, C, E, K) и минеральных веществ (калий, фосфор, цинк, магний, натрий, железо, медь и другие). Также груши богаты пищевыми волокнами и полезными жирными кислотами.</p>\n\n<br />"', false, '2021-01-28 13:16:27.321673', 'pear');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (16, 'Киви', '"<h1> Киви</h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/kiwi1.jpg\" />\n</p>\n\n<i>Латинское название:</i> <code><i>Actinidia</i></code> <br />\n<i>Английское название:</i> <code><i>Kiwifruit</i></code> <br />\n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение </p>\n<p><i>Употребление в пищу:</i> плоды съедобны</p>\n\n<h2> Описание </h2>\n<p>Киви- кустарниковая лиана длиной до 9м. Продолжительность жизни киви составляет более 30 лет. Цветение длится в течение нескольких недель с начала мая по июнь в зависимости от климатических условий места произрастания. Лианы, выращенные из семян, зацветают обычно через 5–7 лет после посева семян, а выращенные из черенков и отводков цветут уже на 3–4 год.</p>\n\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/kiwi2.png\" /> <br />\n  Цветок киви\n</p>\n\n\n<h2> Географическое распространение </h2>\n<p>Киви выращивают во многих странах с субтропическим климатом, особенно широко — в Италии, Новой Зеландии, Чили.</p> \n\n<h2> Значение и применение </h2>\n<p>Плоды киви употребляют в пищу.\n\n</p><p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/kiwi3.jpg\" /> <br />\nПлоды киви\n</p>\n\n<h2> Чем полезно </h2>\n<p>В киви содержится много витамина С (1 киви в день покрывает суточную норму данного витамина).</p>\n\n<br />"', false, '2021-01-29 08:56:51.97435', 'kiwifruit');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (17, 'Гранат', '"<h1> Гранат </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/pun1.jpg\" />\n</p>\n\n<i>Латинское название:</i> <code><i>Punica</i></code> <br />\n<i>Английское название:</i> <code><i>Punica</i></code>\n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение</p> \n<p><i>Употребление в пищу:</i> плоды съедобны</p> \n\n<h2> Описание </h2>\n<p>Гранат представляет собой кустарники или небольшие деревья, достигающин 5-6 м в высоту. Цветет только при достаточном освещение и минимум через 3 года после посадки. Гранат размножается семенами, черенкованием и прививкой. Продолжительность жизни растения составляет 50 лет. </p> \n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/pun2jpg.jpg\" />\n  <br /> Цветок граната\n</p>\n\n\n<h2> Географическое распространение </h2>\n<p>Культура граната распространена по всему земному шару в тропиках и субтропиках. Его возделывают в Афганистане, странах Ближнего Востока, Иране, Испании, Италии, Греции, на Кавказе (в Азербайджане, Армении и Грузии), Португалии, Таджикистане, Узбекистане, Франции, странах бывшей Югославии. В России гранат культивируют на Черноморском побережье, в Северной Осетии, южном Дагестане и в Крыму.</p> \n\n<h2> Значение и применение </h2>\n<p>Основное назначение граната - употребление в пищу. Кожура плодов и кора дерева используется для получения естественных красителей, которые окрашивают органические волокна в коричневый, черный и пепельный цвета.</p> \n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/pun3.jpg\" /> <br />\n  Плод  граната\n</p>\n \n<h2> Чем полезно </h2>\n<p>Плоды граната богаты сахарами, таннинами, витамином С, содержат клетчатку, минеральные вещества и микроэлементы: кальций, магний, калий, марганец, натрий.</p>  \n\n<br />"', false, '2021-01-29 10:30:48.025131', 'punica');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (14, 'Цитрусы', '"<h1> Цитрусы </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/cit1.jpg\" />\n</p>\n\n<i>Латинское название:</i> <code><i>Citrus</i></code> <br />\n<i>Английское название:</i> <code><i>Citrus</i></code>\n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение</p>\n<p><i>Употребление в пищу:</i> плоды съедобны</p>\n\n<h2> Описание </h2>\n<p>Цитрусы представляют собой вечнозеленые кустарники или деревья.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/cit2.jpg\" />\n\n</p>\n\n\n<h2> Географическое распространение</h2>\n<p>На сегодняшний день цитрусовые выращиваются в более чем 70 странах с субтропическим и тропическим климатом. На территории России в открытом грунте произрастают только в самой южной части черноморского побережья Краснодарского края в районе Сочи.</p>\n\n<h2> Значение и применение</h2>\n<p>Плоды цитрусовых имеют высокие вкусовые, диетические и пищевые качества. Из листьев и из цветков извлекают ценные эфирные масла, которые находят широкое применение в парфюмерии. Древесина используется в мебельной промышленности.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/cit3.jpg\" />\n<br /> Плоды цитрусовых\n</p>\n\n<h2> Чем полезно</h2>\n<p>В плодах цитрусовых содержатся витамины А, В1, B2, Р, каротин, 32 гликозида (понцирин, нарингин, гесперидин, цитронин, нарингенин, рутиноцид, диосмин, лимоцитрин, цитромитин, танжеридин и др.), обладающие свойствами P-активных веществ (флавоноиды), сахара, органические кислоты, пектиновые вещества, минеральные соли, эфирные масла.</p>\n\n<br />"', false, '2021-01-28 13:30:28.608828', 'citrus');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (7, 'Яблоня', '"<h1> Яблоня </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/apple1.jpg\" />\n</p>\n\n<i>Латинское название:</i> <code><i>Malus</i></code>  <br />\n<i>Английское название:</i>  <code><i>Apple</i></code> \n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение </p>\n<p><i>Употребление в пищу:</i> плоды съедобны</p>\n\n<h2> Описание</h2>\n<p>Яблоня - дерево высотой 2,5—15 м. Цветет яблоня около двух недель в апреле или мае. Размножается в основном отводками, черенками и прививкой. Продолжительности жизни яблони составляет 40-50 лет. Плодоношение начинается не раньше четвертого года жизни.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/apple2.jpg\" /><br />\n </p><p align=\"center\"> Цветущая яблоня </p>\n<p></p>\n\n\n<h2> Географическое распространение</h2>\n<p>Яблоня произрастает в умеренных широтах. В Евразии дикие яблони растут по всему континенту. Яблони можно встретить в европейских странах, расположенных на крайнем западе материка, в Альпах, и на Дальнем Востоке, в Монголии, Китае, на Кавказе, в Средней Азии, Турции, Иране.</p>\n<h2>Значение и применение</h2>\n<p>Плоды употребляют в свежем виде и в виде сухофруктов. Яблоки пригодны для различных видов переработки: получения соков, компотов, киселей и плодового вина, сидра, приготовления варенья, а благодаря содержанию пектина — джемов, повидла, желе и мусса. </p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/apple3.jpg\" /> <br />\n </p><p align=\"center\"> Сушенные яблоки </p>\n<p></p>\n\n<h2> Чем полезно</h2>\n<p>Плоды содержат яблочную, винную, лимонную и другие органические кислоты, сахара (глюкозу, сахарозу и другие), витамины С, А, В1, каротин, дубильные и пектиновые вещества, микроэлементы (железо, медь), макроэлементы (калий, кальций, магний и другие), эфирное масло, и другие вещества.</p>\n\n<br />"', false, '2021-01-22 06:21:35.302325', 'apple');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (19, 'Слива', '"<h1> Слива </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/plum1.jpg\" />\n</p>\n\n<p><i>Латинское название:</i><code><i>Prunus domestica</i></code><br />\n</p><p><i>Английское название:</i> <code><i>Plum</i></code>\n\n</p><hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение </p>\n<p><i>Употребление в пищу:</i> плоды съедобны</p>\n\n<h2> Описание </h2>\n<p>Слива представляет собой дерево высотой до 15 м. Продолжительность жизни дерева зависит от сорта и может достигать 25 лет. Плодоношение у скороплодных сортов начинается на 2-3 год, а у позднеплодные на 6-7 год. Цветет слива в мае в течение 6—12 дней.  Размножается слива косточками, порослью, корневыми и зелеными черенками, прививкой.  </p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/plum2.jpg\" /> <br />\n  Цветение сливы\n</p>\n\n\n<h2>Географическое распространение</h2>\n<p>Географическим центром происхождения можно считать территорию, простирающуюся от Восточного Кавказа до восточного побережья Адриатического моря, включая Балканский полуостров и Малую Азию.\n\n</p><h2> Значение и применение</h2>\n<p>Плоды сливы часто используют для приготовления компотов, варенья и джема. Сушёные плоды сливы называются черносливом и относятся к сухофруктам.Из семян сливы домашней получают невысыхающее масло для медицинской промышленности.Сливовые деревья ценятся как декоративные, их используют при озеленении. </p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/plum3.jpg\" /> <br />\n Сливовое варенье\n</p>\n\n<h2> Чем полезно</h2>\n<p>Плоды сливы содержат витамины A (в плодах тёмного цвета), B1, B2, C и P и необходимые элементы: калий, фосфор (содержание которых больше, чем в яблоках и грушах), кальций, магний, железо. В плодах сливы содержатся также органические кислоты (яблочная и лимонная, а также щавелевая и следы салициловой), пектиновые, дубильные, азотистые вещества.</p>\n\n<br />"', false, '2021-01-29 11:35:12.715981', 'plum');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (18, 'Виноград ', '"<h1> Виноград </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/grape1.jpg\" />\n</p>\n\n<i>Латинское название:</i> <code><i>Vitis</i></code> <br />\n<i>Английское название:</i> <code><i>Grape</i></code>\n\n<hr />\n\n<p> <i>Продолжительность жизни:</i> многолетнее растение</p>  \n<p> <i>Употребление в пищу:</i> плоды съедобны</p> \n\n<h2> Описание </h2>\n<p> Виноград -  кустарниковая лиана. На юге лиана винограда достигает 30—40 метров длины, в средней полосе России, как правило, всего 1,5—3 м. Цветёт виноград в мае—июне, плодоносит в августе—сентябре, некоторые сорта в октябре. Предельным возрастом растений винограда принято считать 80—100 лет. При правильном уходе виноград может зацвести на следующий год после посадки.</p> \n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/grape2.jpg\" /> <br />\n  Цветение винограда\n</p>\n\n\n<h2> Географическое распространение </h2>\n<p> Виноград растёт в умеренных и субтропических регионах.</p> \n\n<h2> Значение и применение </h2>\n<p> Виноград едят свежим или сушат, превращая его в изюм. Плоды винограда — сырьё для изготовления вина. Из винограда готовят компоты, соки, маринады. Используют в декоративных целях. Из виноградных косточек выжимают масло, а виноградный лист используется для приготовления долмы и других фаршированных блюд.</p> \n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/grape3.jpg\" />\n  <br />Изюм\n</p>\n\n<h2> Чем полезно </h2>\n<p> В плодах винограда содержится до 20 % сахара, витамины С, В, ферменты, микроэлементы, яблочная и другие органические кислоты, дубильные вещества.</p> \n\n<br />"', false, '2021-01-29 10:57:20.399235', 'grape');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (5, 'Персик ', '"<h1> Персик </h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/peach1.jpg\" />\n</p>\n\n<i>Латинское название:</i> <code><i>Prunus persica</i></code> <br />\n<i>Английское название:</i> <code><i>Peach</i></code>\n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение </p>\n<p><i>Употребление в пищу:</i> плоды съедобны</p>\n\n<h2>Описание</h2>\n<p>Персиковое дерево появилось в результате гибридизации многих видов из рода сливовых. Персики размножают семенным способом, прививкой и черенкованием. В плодоношение персиковые деревья вступают через 2-4 года с момента посадки, период плодоношения длится 10-15 лет. Цветет персик с середины апреля. Издали персиковое дерево покрытое цветками очень схоже с сакурой. Вырастает дерево не более 6-8 метров.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/peach2.jpg\" /> <br />\n  Цветущее персиковое дерево\n</p>\n\n\n<h2>Географическое распространение</h2>\n<p>Разводится из-за плодов в южных регионах Евразии (в том числе на юге России, в Закавказье и Средней Азии, на Украине, в Молдавии) и в Америке.</p>\n<h2>Значение и применение</h2>\n<p>Плоды персиков широко употребляются в пищу в свежем и переработанном виде.  Из косточек изготовлялся ликёр «персико». Сушёные плоды персика называются шептала́. Семена являются сырьём для получения персикового масла (лат. <i>Oleum Persicorum</i>), используемого в медицине и косметике. </p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/peach3.jpg\" /> <br />\n  Масло из персиковых косточек \n</p>\n\n<h2>Чем полезно</h2>\n<p>В мякоти плодов персика обыкновенного присутствуют: \n<br />• Органические кислоты: яблочная, хинная, лимонная, винная.\n<br />• Минеральные соли: калий, железо, фосфор, марганец, медь, цинк, селен и магний.\n<br />• Витамины: С, группы В, Е, К, РР, каротин.\n<br />• Пектины и эфирные масла.\n<br />В косточках есть горькое миндальное масло и амигдалин.\n</p>\n<br />"', false, '2021-01-13 07:47:33.097294', 'peach');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (3, 'Хурма', '"<h1> Хурма </h1> \n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/perm3.jpg\" />\n</p>\n\n<i>Латинское название:</i> <i><code>Diospyros</code></i> <br />\n<i>Английское название:</i>  <i><code>Persimmon</code></i>\n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение </p>\n<p><i>Употребление в пищу:</i> плоды съедобны</p>\n\n<h2> Описание</h2>\n<p>При субтропическом, тропическом климате, с хорошим уходом деревья живут до 350–500 лет. В среднем дерево достигает 8–20 метров. Хурма начинает цвести в конце весны и начале лета в зависимости от сорта и региона произрастания. Первый раз растение зацветает при соблюдении всех условий посадки на третий год после посадки саженца.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/perm2.jpg\" /> <br />\n  Цветение хурмы\n</p>\n\n\n<h2> Географическое распространение</h2>\n<p>Хурма распространена во всех частях суши тропического пояса, с наибольшим разнообразием в Индомалайской области. В культуре растения распространились, вероятно, из Китая. Ради плодов растения культивируются во многих странах Евразии, Америки и в Австралии.</p>\n\n<h2> Значение и применение</h2>\n<p>Плоды хурмы употребляются в пищу в свежем виде. Из древесины дерева в ряде стран делают мебель и спортивные принадлежности. Древесина хурмы столь изысканна и деликатна, что из неё делают некоторые музыкальные инструменты.</p> \n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/persimmon1.jpg\" />\n <br />Плоды хурмы\n</p>\n\n<h2> Чем полезно </h2>\n<p>Хурма считается диетическим продуктом, так как в 100 граммах хурмы содержится всего 66 ккал. Однако хурма содержит очень много сахара. В составе плода присутствуют такие ценные и полезные вещества как, аскорбиновая и никотиновая кислота, бета-каротины и ретинол, токоферол и витамины группы В и D. </p> \n\n<br />"', false, '2021-01-12 11:53:34.594219', 'persimmon');
INSERT INTO plant (id, name, content, is_deleted, insert_datetime, ai_name) VALUES (10, 'Черешня', '"<h1> Черешня</h1>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/merry1.jpg\" />\n</p>\n\n<i>Латинское название:</i> <code><i>Prunus avium</i></code> <br />\n<i>Английское название:</i> <code><i>Merry</i></code> \n\n<hr />\n\n<p><i>Продолжительность жизни:</i> многолетнее растение </p>\n<p><i>Употребление в пищу:</i> плоды съедобны</p>\n\n<h2> Описание </h2>\n<p>Черешня — древесное растение. Черешня самобесплодна. Для опыления требуется посадка 2—3 деревьев. Плодоношение черешни начинается с четырехлетнего либо пятилетнего возраста. Для размножения черешни используют семена, а также прививку. Деревья следует использовать до 15 лет.  Дерево достигает в высоту в среднем 10 метров.</p>\n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/merry2.jpg\" /> <br />\n  Цветущая черешня\n</p>\n\n<h2> Географическое распространение </h2>\n<p>В природе черешня произрастает в Европе, Западной Азии, Северной Африке и широко распространенное в культуре.</p> \n\n<h2> Значение и применение </h2>\n<p>Чаще всего черешня используется в пищу сырой, но ее также сушат, замораживают, глазируют, заспиртовывают, маринуют. <br /> Среди косточковых черешня занимает первое место по нектаропродуктивности. Медопродуктивность достигает 35 кг с гектара насаждений. Черешня является ценным апрельско-майским медоносом, дающим пчёлам нектар, пыльцу-обножку и клей-прополис.<br />\nДревесина пригодна для столярных изделий, из молодых стволов делают обручи. </p> \n\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/merry3.jpg\" /> <br />\n  Маринованная черешня\n</p>\n\n<h2> Чем полезно </h2>\n<p>В черешне содержатся органические кислоты, сахара (фруктоза, глюкоза), витамины C, A, B1, B2, E, PP, микроэлементы (железо, йод), макроэлементы (калий, кальций, магний и другие), пектиновые вещества, а также большое количество антоцианов — веществ из группы флавоноидов.</p>\n \n\n<br />"', false, '2021-01-28 05:23:25.341828', 'merry');
