INSERT INTO public.articles (id, user_id, title, article_text, article_preview, insert_date, is_deleted) VALUES (7, 211, 'Хурма (лат. Diōspyros) ', '{"blocks": [{"key": "2gq8h", "data": {}, "text": " Хурма (лат. Diōspyros) — род субтропических и тропических листопадных или вечнозелёных деревьев и кустарников семейства Эбеновые (Ebenaceae).    ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 142, "offset": 0}, {"style": "BOLD", "length": 6, "offset": 1}, {"style": "fontsize-12pt", "length": 10, "offset": 2}, {"style": "fontsize-12pt", "length": 16, "offset": 13}, {"style": "fontsize-12pt", "length": 28, "offset": 30}, {"style": "fontsize-12pt", "length": 28, "offset": 59}, {"style": "fontsize-12pt", "length": 22, "offset": 88}, {"style": "fontsize-12pt", "length": 9, "offset": 111}, {"style": "fontsize-12pt", "length": 21, "offset": 121}, {"style": "color-windowtext", "length": 4, "offset": 8}, {"style": "color-windowtext", "length": 3, "offset": 26}, {"style": "color-windowtext", "length": 14, "offset": 30}, {"style": "color-windowtext", "length": 11, "offset": 47}, {"style": "color-windowtext", "length": 11, "offset": 59}, {"style": "color-windowtext", "length": 12, "offset": 75}, {"style": "color-windowtext", "length": 8, "offset": 88}, {"style": "color-windowtext", "length": 11, "offset": 99}, {"style": "color-windowtext", "length": 9, "offset": 111}, {"style": "color-windowtext", "length": 8, "offset": 121}, {"style": "ITALIC", "length": 9, "offset": 13}, {"style": "ITALIC", "length": 9, "offset": 131}]}, {"key": "3sq90", "data": {}, "text": " ", "type": "atomic", "depth": 0, "entityRanges": [{"key": 0, "length": 1, "offset": 0}], "inlineStyleRanges": []}, {"key": "ckrgn", "data": {}, "text": " продолжительность жизни Многолетнее растение. Деревья могут доживать до пятисот лет.  ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 87, "offset": 0}, {"style": "BOLD", "length": 24, "offset": 0}, {"style": "bgcolor-rgb(97,189,109)", "length": 25, "offset": 0}, {"style": "fontsize-12pt", "length": 45, "offset": 1}, {"style": "fontsize-12pt", "length": 39, "offset": 47}, {"style": "bgcolor-rgb(255,255,255)", "length": 62, "offset": 25}]}, {"key": "cafn1", "data": {"margin-left": "0cm"}, "text": " употребление в пищу  У многих видов плоды съедобны.   ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 55, "offset": 0}, {"style": "bgcolor-rgb(204,204,204)", "length": 21, "offset": 0}, {"style": "BOLD", "length": 21, "offset": 0}, {"style": "fontsize-12pt", "length": 20, "offset": 1}, {"style": "fontsize-12pt", "length": 14, "offset": 22}, {"style": "fontsize-12pt", "length": 16, "offset": 37}, {"style": "color-windowtext", "length": 5, "offset": 31}, {"style": "color-windowtext", "length": 5, "offset": 37}]}, {"key": "cq686", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "90v10", "data": {}, "text": " ", "type": "atomic", "depth": 0, "entityRanges": [{"key": 1, "length": 1, "offset": 0}], "inlineStyleRanges": []}, {"key": "857gr", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "8gsuq", "data": {}, "text": " распространение  Виды этого рода распространены во всех частях суши тропического пояса, с наибольшим разнообразием в Индомалайской области. В культуре растения распространились, вероятно, из Китая. Ради плодов растения культивируются во многих странах Евразии, Америки и в Австралии, где встречаются и свои эндемичные виды.    ", "type": "unstyled", "depth": 0, "entityRanges": [{"key": 2, "length": 1, "offset": 327}], "inlineStyleRanges": [{"style": "bgcolor-white", "length": 54, "offset": 35}, {"style": "fontsize-14", "length": 1, "offset": 17}, {"style": "fontsize-16", "length": 17, "offset": 0}, {"style": "fontsize-16", "length": 310, "offset": 18}, {"style": "fontsize-12pt", "length": 17, "offset": 0}, {"style": "fontfamily-Georgia", "length": 328, "offset": 0}, {"style": "BOLD", "length": 17, "offset": 0}, {"style": "bgcolor-rgb(204,204,204)", "length": 17, "offset": 0}, {"style": "color-black", "length": 54, "offset": 35}, {"style": "color-rgb(0,0,0)", "length": 18, "offset": 0}]}, {"key": "a8bj1", "data": {}, "text": " полезные свойства Несмотря на относительно высокое содержание сахара хурма не способствует резкому повышению сахара в крови (имеет невысокий гликемический индекс) и на 100 г продукта содержит всего 62 ккал. Ярко-оранжевый цвет хурмы говорит о том, что в ней высокое содержание бета-каротина и биофлавоноидов. Спелая хурма содержит (от дневной нормы потребления): 25 % сахаров, 1,5 % протеина, 0,85 % жиров, до 55 % витамина С, дубильные вещества, различные микроэлементы, в том числе иод, железо, магний, калий.  ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 514, "offset": 0}, {"style": "fontsize-16", "length": 514, "offset": 0}, {"style": "bgcolor-rgb(204,204,204)", "length": 19, "offset": 0}, {"style": "BOLD", "length": 19, "offset": 0}]}, {"key": "4335l", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "bps1c", "data": {}, "text": " ", "type": "atomic", "depth": 0, "entityRanges": [{"key": 3, "length": 1, "offset": 0}], "inlineStyleRanges": []}, {"key": "9t9bo", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "4s25n", "data": {}, "text": " практическое значение  Плоды хурмы можно употреблять в свежем виде, высушивать, варить из них варенья, десерты, делать сидр, патоку, вино, пиво и самогон.  ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 157, "offset": 0}, {"style": "fontsize-16", "length": 157, "offset": 0}, {"style": "BOLD", "length": 24, "offset": 0}, {"style": "bgcolor-rgb(204,204,204)", "length": 24, "offset": 0}]}, {"key": "ff9qa", "data": {}, "text": "Обжаренные и измельчённые семена хурмы виргинской использовались солдатами армии Конфедерации и населением штатов Юга во время Гражданской войны в США как заменитель кофе.  ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 173, "offset": 0}, {"style": "fontsize-16", "length": 173, "offset": 0}]}, {"key": "926dt", "data": {}, "text": "Из древесины дерева в ряде стран делают мебель и спортивные принадлежности. Древесина хурмы столь изысканна и деликатна, что из неё делают некоторые музыкальные инструменты. Знаменитое чёрное эбеновое дерево получают из древесины хурмы.   ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 239, "offset": 0}, {"style": "fontsize-16", "length": 239, "offset": 0}]}, {"key": "cptdf", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}], "entityMap": {"0": {"data": {"src": "http://businesspskov.ru/pictures/191108113403.jpg", "width": "auto", "height": "auto"}, "type": "IMAGE", "mutability": "MUTABLE"}, "1": {"data": {"src": "https://avatars.mds.yandex.net/get-zen_doc/1586459/pub_5d90e0a43639e600aefe1531_5d90e3aea660d700ae014554/scale_1200", "width": "100%", "height": "auto"}, "type": "IMAGE", "mutability": "MUTABLE"}, "2": {"data": {"src": "https://avatars.mds.yandex.net/get-zen_doc/1586459/pub_5d90e0a43639e600aefe1531_5d90e3aea660d700ae014554/scale_1200", "width": "auto", "height": "auto", "alignment": "left"}, "type": "IMAGE", "mutability": "MUTABLE"}, "3": {"data": {"src": "https://auctions.c.yimg.jp/images.auctions.yahoo.co.jp/image/dr000/auc0504/users/41f7649744623da570149fbbc791f07a1b81e64c/i-img1200x1200-1555040118nycmha175191.jpg", "width": "100%", "height": "auto"}, "type": 