INSERT INTO public.articles (id, user_id, title, article_text, article_preview, insert_date, is_deleted) VALUES (8, 211, 'Перечень существующих пестицидов', '{"blocks": [{"key": "1vkii", "data": {}, "text": "Пестициды используются для уничтожения либо прекращения развития насекомых, кле­щей, млекопитающих (грызунов), бактерий, вирусов, спор грибов, вредной растительности и других живых организмов, наносящих ущерб растениеводству и животноводству и вызывающих ухудшение качества сельскохозяйственной продукции, материалов и изделий. Также они применяются для борьбы с па­разитическими организмами и переносчиками опасных заболеваний человека.Виды пестицидов ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(51,51,51)", "length": 27, "offset": 0}, {"style": "color-rgb(51,51,51)", "length": 6, "offset": 38}, {"style": "color-rgb(51,51,51)", "length": 299, "offset": 55}, {"style": "color-rgb(51,51,51)", "length": 77, "offset": 360}, {"style": "bgcolor-rgb(255,255,255)", "length": 27, "offset": 0}, {"style": "bgcolor-rgb(255,255,255)", "length": 6, "offset": 38}, {"style": "bgcolor-rgb(255,255,255)", "length": 299, "offset": 55}, {"style": "bgcolor-rgb(255,255,255)", "length": 77, "offset": 360}, {"style": "fontfamily-Georgia", "length": 453, "offset": 0}, {"style": "fontsize-16", "length": 453, "offset": 0}, {"style": "color-rgb(0,0,0)", "length": 15, "offset": 437}, {"style": "fontsize-14pt", "length": 15, "offset": 437}, {"style": "ITALIC", "length": 15, "offset": 437}, {"style": "BOLD", "length": 16, "offset": 437}]}, {"key": "clgqk", "data": {}, "text": "Пестициды различаются по своему химическому составу, объектам применения, способу проникновения и характеру (специфике) воздействия.  Существуют следующие группы пестицидов: неорганические соединения (соединения ртути, фтора, ба­рия, серы, меди, а также хлораты и бораты), а также средства растительного, бактериального и грибного происхождения (пиретрины, фитонциды и анти­биотики, бактериальные и грибные препараты). Но наиболее обширная группа пестицидов все - таки производится на основе органических соединений, поскольку они обладают наиболее высокой физиологической активностью.", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(0,0,0)", "length": 133, "offset": 0}, {"style": "color-rgb(0,0,0)", "length": 451, "offset": 134}, {"style": "fontsize-14pt", "length": 133, "offset": 0}, {"style": "fontsize-14pt", "length": 451, "offset": 134}, {"style": "fontfamily-Georgia", "length": 585, "offset": 0}, {"style": "fontsize-16", "length": 585, "offset": 0}, {"style": "ITALIC", "length": 69, "offset": 201}, {"style": "ITALIC", "length": 70, "offset": 346}]}, {"key": "cdp9b", "data": {"text-align": "center"}, "text": " Перечень существующих пестицидов ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "ITALIC", "length": 34, "offset": 0}, {"style": "fontfamily-Georgia", "length": 34, "offset": 0}, {"style": "BOLD", "length": 34, "offset": 0}, {"style": "color-black", "length": 32, "offset": 1}, {"style": "bgcolor-white", "length": 32, "offset": 1}, {"style": "fontsize-14pt", "length": 32, "offset": 1}]}, {"key": "ck9r", "data": {"margin-left": "36pt"}, "text": "· Акарициды –средства, предназначенные для борьбы с растительноядными клещами  ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-black", "length": 1, "offset": 0}, {"style": "fontsize-16pt", "length": 1, "offset": 0}, {"style": "fontfamily-Georgia", "length": 79, "offset": 0}]}, {"key": "d5fvv", "data": {"margin-left": "36pt"}, "text": "· Альгициды – препараты, которые способствуют уничтожению чрезмерной растительности (водорослей) в водоемах  ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-black", "length": 1, "offset": 0}, {"style": "color-black", "length": 106, "offset": 2}, {"style": "fontsize-16pt", "length": 1, 