neStyleRanges": []}], "entityMap": {"0": {"data": {"src": "https://img11.postila.ru/data/bc/4c/cc/fb/bc4cccfb4b4bfc0313b7bdf4c9d8f24563dc8234d2357e3f10b065a7efa183af.jpg", "width": "100%", "height": "auto", "alignment": "none"}, "type": "IMAGE", "mutability": "MUTABLE"}}}', '{"blocks": [{"key": "368a9", "data": {}, "text": "Пестицид – вещество (или смесь веществ) химического либо биологического происхождения, предназначенное для уничтожения вредных насекомых, грызунов, сорняков, возбудителей болезней растений и животных, а также используемое в качестве дефолианта, десиканта и регулятора роста.", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 274, "offset": 0}, {"style": "fontsize-16", "length": 274, "offset": 0}, {"style": "ITALIC", "length": 9, "offset": 0}, {"style": "BOLD", "length": 9, "offset": 0}, {"style": "color-rgb(51,51,51)", "length": 266, "offset": 8}, {"style": "bgcolor-rgb(255,255,255)", "length": 266, "offset": 8}]}], "entityMap": {}}', '2020-12-08 11:00:22.526032', true);
INSERT INTO public.articles (id, user_id, title, article_text, article_preview, insert_date, is_deleted) VALUES (9, 211, 'Топ-5 сортов лимона для выращивания дома', '{"blocks": [{"key": "af3un", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "2h91s", "data": {}, "text": " Растения лимона отлично растут в комнатных условиях, если правильно выбрать сорт. А посадив несколько подвидов, можно получить лимоны\nразличного размера, вкуса, оттенков цвета и формы.  ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(0,0,0)", "length": 185, "offset": 0}, {"style": "fontfamily-Georgia", "length": 187, "offset": 0}, {"style": "fontsize-16", "length": 187, "offset": 0}, {"style": "bgcolor-white", "length": 184, "offset": 1}]}, {"key": "6asgg", "data": {}, "text": "Сортов лимона в настоящее время более 30. Хотим предоставить Вам топ-5 сортов лимона отлично подходящих для выращивания дома.", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 125, "offset": 0}, {"style": "fontsize-16", "length": 125, "offset": 0}]}, {"key": "dkhjr", "data": {}, "text": "1. Павловский ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 14, "offset": 0}, {"style": "BOLD", "length": 14, "offset": 0}, {"style": "fontsize-18", "length": 14, "offset": 0}]}, {"key": "3g90m", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "e5qt6", "data": {}, "text": " ", "type": "atomic", "depth": 0, "entityRanges": [{"key": 0, "length": 1, "offset": 0}], "inlineStyleRanges": []}, {"key": "bmuni", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "755s2", "data": {}, "text": "Павловский лимон прекрасно закален и замечательно переносит и недостаток света и сухой воздух. При правильном уходе уже на 3 год может начать цвести и давать сочные, вкусные и ароматные плоды. Листья растения насыщают комнату кислородом и эфирными маслами, которые дарят бодрость и хорошее настроение.", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(0,0,0)", "length": 301, "offset": 0}, {"style": "fontfamily-Georgia", "length": 301, "offset": 0}, {"style": "fontsize-16", "length": 301, "offset": 0}, {"style": "bgcolor-white", "length": 206, "offset": 95}]}, {"key": "5fn2h", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "2qllb", "data": {}, "text": "2.   Мейера", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontfamily-Georgia", "length": 11, "offset": 0}, {"style": "fontsize-18", "length": 11, "offset": 0}, {"style": "BOLD", "length": 11, "offset": 0}, {"style": "bgcolor-rgb(255,255,255)", "length": 6, "offset": 5}]}, {"key": "9kqkq", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "8na1u", "data": {}, "text": " ", "type": "atomic", "depth": 0, "entityRanges": [{"key": 1, "length": 1, "offset": 0}], "inlineStyleRanges": []}, {"key": "fo9t3", "data": {}, "text": "Этот сорт обладает умеренными темпами роста, он раннецветущий. В домашних условиях растение выращивать легко, так как этот лимон отличается относительной неприхотливостью. Благодаря этому во многих странах лимон Майера является промышленной культурой и выращивается на весьма обширных территориях.", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "bgcolor-rgb(255,255,255)", "length": 297, "offset": 0}, {"style": "fontsize-16", "length": 297, "offset": 0}, {"style": "fontfamily-Georgia", "length": 297, "offset": 0}, {"style": "color-rgb(0,0,0)", "length": 297, "offset": 0}]}, {"key": "barnm", "data": {}, "text": "3. Пандероза", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "bgcolor-rgb(255,255,255)", "length": 12, "offset": 0}, {"style": "fontfamily-Georgia", "length": 12, "offset": 0}, {"style": "color-rgb(0,0,0)", "length": 12, "offset": 0}, {"style": "BOLD", "length": 12, "offset": 0}, {"style": "fontsize-18", "length": 12, "offset": 0}]}, {"key": "44t09", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "d30ca", "data": {}, "text": " ", "type": "atomic", "depth": 0, "entityRanges": [{"key": 2, "length": 1, "offset": 0}], "inlineStyleRanges": []}, {"key": "1l76d", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "6gp7t", "data": {"text-align": "left"}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "1h3e5", "data": {"text-align": "left"}, "text": "Главное отличие сортового лимона Пандероза – это крупные плоды. Скорее даже не просто крупные, а очень крупные, на нем порой вырастают лимоны весом более килограмма. Но понятно, что для этого само растение должно набрать хороший ресурс и само окрепнуть. Это может ввести в замешательство начинающего цитрусовода, ведь хочется сразу приобрести себе деревце, с которым не будет много хлопот.", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "fontsize-16", "length": 389, "offset": 0}, {"style": "fontfamily-Georgia", "length": 389, "offset": 0}, {"style": "color-rgb(0,0,0)", "length": 389, "offset": 0}]}, {"key": "f39dc", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "8mi44", "data": {}, "text": "4. Юбилейный", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "BOLD", "length": 12, "offset": 0}, {"style": "fontsize-18", "length": 12, "offset": 0}, {"style": "bgcolor-rgb(255,255,255)", "length": 9, "offset": 3}]}, {"key": "b4af3", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "4ddk3", "data": {}, "text": " ", "type": "atomic", "depth": 0, "entityRanges": [{"key": 3, "length": 1, "offset": 0}], "inlineStyleRanges": []}, {"key": "8803n", "data": {}, "text": "Юбилейный сорт заслуживает внимания специалистов и любителей своей теневыносливостью, урожайностью, уникальной способностью к размножению, росту, и 100% завязыванию плодов в условиях низкой влаги воздуха и почвы. Является крупноплодным сортом (плоды до 600 г). Кожица  толстая. Этот домашний лимон многих привлекает обильным цветением, во  время которого деревце почти сплошь покрыто белыми цветками с чуть  фиолетовым оттенком. ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "color-rgb(0,0,0)", "length": 214, "offset": 0}, {"style": "bgcolor-rgb(255,255,255)", "length": 429, "offset": 0}, {"style": "fontfamily-Georgia", "length": 429, "offset": 0}, {"style": "fontsize-16", "length": 429, "offset": 0}, {"style": "color-rgb(40,40,40)", "length": 215, "offset": 214}]}, {"key": "e54vj", "data": {}, "text": "5. Рука Будды", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "bgcolor-rgb(255,255,255)", "length": 13, "offset": 0}, {"style": "color-rgb(40,40,40)", "length": 13, "offset": 0}, {"style": "fontfamily-Georgia", "length": 13, "offset": 0}, {"style": "fontsize-18", "length": 13, "offset": 0}, {"style": "BOLD", "length": 13, "offset": 0}]}, {"key": "76b0a", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "e6asv", "data": {}, "text": " ", "type": "atomic", "depth": 0, "entityRanges": [{"key": 4, "length": 1, "offset": 0}], "inlineStyleRanges": []}, {"key": "1a8rh", "data": {}, "text": "Если вы хотели знать, какой лимон является самым оригинальным, то  это, без сомнения, Рука Будды. Обзаводятся таким комнатным лимоном  обычно ради его декоративных качеств. Больше всего внимания привлекают  его плоды: длинные, до 40 см, в виде грозди бананов или руки (за что  сорт и получил название). Рука Будды не переносит холодов, поэтому может погибнуть даже от непродолжительных низких температур. Но в помещении его можно ставить на подоконник даже в зимнее время года.", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "bgcolor-rgb(255,255,255)", "length": 303, "offset": 0}, {"style": "bgcolor-rgb(255,255,255)", "length": 164, "offset": 313}, {"style": "fontfamily-Georgia", "length": 477, "offset": 0}, {"style": "fontsize-16", "length": 477, "offset": 0}, {"style": "color-rgb(0,0,0)", "length": 477, "offset": 0}]}, {"key": "7qt0p", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}, {"key": "5qkja", "data": {}, "text": " ", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "bgcolor-rgb(255,255,255)", "length": 1, "offset": 0}, {"style": "fontfamily-Georgia", "length": 1, "offset": 0}, {"style": "fontsize-18", "length": 1, "offset": 0}, {"style": "BOLD", "length": 1, "offset": 0}]}, {"key": "ald2u", "data": {}, "text": "", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": []}], "entityMap": {"0": {"data": {"src": "https://topnewsrussia.ru/wp-content/uploads/2019/08/limon.jpg", "width": "auto", "height": "auto"}, "type": "IMAGE", "mutability": "MUTABLE"}, "1": {"data": {"src": "https://pavlovolimon.ru/wp-content/uploads/2018/06/Лимон-мейера-растение-с-плодами-340x255.jpg", "width": "auto", "height": "auto", "alignment": "left"}, "type": "IMAGE", "mutability": "MUTABLE"}, "2": {"data": {"src": "https://avatars.mds.yandex.net/get-zen_doc/1675790/pub_5e4a5814a5d3230c1ce781df_5e4ac92307349e4ee436af3b/scale_1200", "width": "auto", "height": "auto"}, "type": "IMAGE", "mutability": "MUTABLE"}, "3": {"data": {"src": "https://4.404content.com/1/2B/2F/1281063328866633112/fullsize.jpg", "width": "auto", "height": "auto", "alignment": "left"}, "type": "IMAGE", "mutability": "MUTABLE"}, "4": {"data": {"src": "https://3.404content.com/1/84/B8/1281063337616213403/fullsize.jpg", "width": "auto", "height": "auto", "alignment": "left"}, "type": "IMAGE", "mutability": "MUTABLE"}}}', '{"blocks": [{"key": "3hic6", "data": {}, "text": "Вечнозеленое красивое деревце лимона с яркими крупными плодами украсит любую комнату и оздоровит воздух, распространяя целебные фитонциды.", "type": "unstyled", "depth": 0, "entityRanges": [], "inlineStyleRanges": [{"style": "bgcolor-rgb(255,255,255)", "length": 138, "offset": 0}, {"style": "fontsize-16", "length": 138, "offset": 0}, {"style": "fontfamily-Georgia", "length": 138, "offset": 0}, {"style": "color-rgb(0,0,0)", "length": 138, "offset": 0}]}], "entityMap": {}}', '2020-12-08 12:44:34.438712', true);
INSERT INTO public.articles (id, user_id, title, article_text, article_preview, insert_date, is_deleted) VALUES (12, 211, 'Весенний уход за садом', '"<p>Важное значение в жизни растений имеет весенняя обработка сада. Весной необходимо подготовить растения к активному развитию, защитить их от болезней и вредителей, внести удобрения, провести правильную и качественную обрезку.</p>\n<p> <i>Начинается новый сезон, и пора заняться садом.</i> </p>\n\n<p>Всего 6 шагов помогут подготовить Ваш сад к новому сезону.</p>\n\n<li> <b>Шаг 1 - Осмотр деревьев и кустарников</b> <br />\n<p>Внимательно осмотрите кору деревьев на предмет повреждений грызунами, трещин, морозобоин или солнечных ожогов;<br />\nПроверьте ветви деревьев и кустов, не сломались ли некоторые под тяжестью снега. Некоторые из них могли погибнуть во время зимы: внешне они подсохшие, а почки на них не развиваются;<br />\nОсмотрите стволы: не образовались ли в них дупла, не появились ли следы опасных болезней, таких как черный рак.<br />\nПроверьте состояние стволов плодовых деревьев на предмет отслаивания коры. Металлической щёткой очистить поврежденные участки;<br />\nОсмотрите состояние веточек ягодных кустарников. Ранней весной, до набухания почек, пролить приствольную часть кустарников кипятком (70-90 °С ).</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/sh1.png\" />\n</p>\n<br />\n\n</li><li> <b>Шаг 2 - Обрезка деревьев и кустов</b><br /><br />\n<p>Обрезка проводится ранней весной, до начала сокодвижения растений.<br />\nНеобходимо провести либо санитарную, либо эстетическую обрезу кроны деревьев и кустарников;<br />\nНеобходимо использовать хорошо заточенный садовый инструмент – секаторы и сучкорезы, не допускать закусывания веточек и рваной обрезки;<br />\nОбработать садовым варом места обрезки. В настоящее время выпускается садовый вар в аэрозольной форме, что делает его удобным в применении.</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/sh2.jpg\" />\n</p>\n<br />\n</li><li> <b>Шаг 3 - Уборка</b><br /><br />\n<p>В опавшей прошлогодней листве также хорошо переносят холода возбудители таких заболеваний, как: парша, черная гниль, пятнистость и многие другие. Поэтому необходимо провести уборку и ликвидирование старой листвы, травы и веток.</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/sh3.jpg\" />\n</p>\n<br />\n</li><li> <b>Шаг 4 - Окапывание приствольных кругов</b><br /><br />\n<p>Перекопка почвы в пристольных участках необходима для улучшения аэрации почвы. Это действие помогает корням получать больше кислорода, в результате они становятся более сильными и поглощают больше воды и питательных веществ. Поэтому можно удобрить и засыпать компостом приствольные круги. Так почва быстрее прогреется, а корни получат достаточно питательных веществ.</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/sh4.jpg\" />\n</p>\n<br />\n</li><li> <b>Шаг 5 - Побелка</b> <br /><br />\n<p>Весной побелка проводится в большей степени с эстетической и профилактической целью. Белая краска на стволах и скелетных ветках отталкивает солнечные лучи, защищает кору от перегрева и не позволяет деревьям пробудиться не вовремя. Поэтому весеннюю побелку осуществляют в феврале или начале марта, когда стволы деревьев могут нагреваться днем до 11 ºC, что провоцирует слишком раннее начало сокодвижения. А ночные температуры в конце зимы и начале весны могут опускаться до -10 ºC, и это приводит к замерзанию сока, разрыву тканей и образованию морозобоин.</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/sh5.jpg\" />\n</p>\n<br />\n</li>\n<li> <b>Шаг 6 - Обработка</b><br /><br />\n<p>Первая обработка самая важная. Во-первых, она действует на личинок в зародыше и еще не активных насекомых, и во-вторых, применение препаратов возможно в их максимальной концентрации.Первое опрыскивание деревьев проводится в саду, когда ночные температуры воздуха чуть выше нуля, а дневные в районе +3-5°С., не началось активное сокодвижение и почки еще не начали набухать.</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/sh6.jpg\" />\n</p>\n<br /></li>"', '"<p>Важное значение в жизни растений Вашего сада имеет весенняя обработка.</p>"', '2021-02-02 07:10:00.400826', false);
INSERT INTO public.articles (id, user_id, title, article_text, article_preview, insert_date, is_deleted) VALUES (14, 211, 'Как проверить всхожесть семян?', '"<p>В связи с приближающимся сезоном выращивания рассады необходимо проверить семена на всхожесть. Особенно это актуально при истекающем сроке годности семян, который можно проверить на упаковке. </p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/srok.jpg\" />\n</p>\n<p>Под всхожестью понимают процентное количество появившихся всходов к общему числу посаженных семян.</p>  <br /> \n\n<p>Благоприятные условия для быстрых всходов – это\n\n<li>постоянная умеренная влажность,\n</li><li>комнатная температура в пределах 20-25º,\n</li><li>достаточная вентиляция, отсутствие доступа воздуха приведет к порче семян,\n</li><li>для прорастания некоторых сортов цветов, зелени необходимо освещение, об этом можно прочитать на упаковке.</li></p>\n\n<p>Рассмотрим несколько способов проверки всхожести семян. </p>\n \n<b>Способ 1 - проращивание</b> <br />\n<p>Необходимо взять 10 семян и поместить их, на расстоянии 1 см друг от друга, на тряпочку или бумагу в емкость. Далее семяна необходимо смочить теплой водой (удобнее это будет сделать из пульверизатора). Затем емкость закрывается полиэтиленовым пакетом и помещается в теплое место. Необходимо каждый день проверять семена, чтобы не пропустить момент появления всходов и не допустить пересыхания семян. Лучший показатель всхожести подразумевает прорастание минимум 6 семечек из 10.</p> <br /> \n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/prorost.jpg\" />\n</p>\n\n<b>Способ 2 - в воде</b>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/vcho1.jpg\" />\n</p>\n<p>Для этого способа необходимо взять глубокую емкость с водой и семена. Если на всхожесть проверяете семена капусты, томаты или редиса, то необходимо добавить чайную ложку соли на стакан воды. </p>\n<p> Далее семена кладем в воду, перемещиваем и ждем 10 минут. Семена оставшиеся на поверхности воды потеряли свою всхожесть. Семена опустившиеся на дно емкости - прорастут. </p> \n <p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/vsho.jpg\" />\n</p>\n<b>Способ 3 - в растворе марганцовки</b>\n<p> Принцип способа такой же,как и у способа 2. Раствор маргацовки позволит Вам обеззаразить семена. </p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/mar.jpg\" />\n</p>\n<b>Способ 4 - в рыхлом грунте</b>\n<p> Самый безошибочный способ проверки всхожести семян - посев в рыхлый грунт. Его следует увлажнить, насыпать в неглубокую емкость и слегка уплотнить. Далее наметить бороздку на грунте,куда высеять семена. Далее семена засыпать грунтом, слегка увлажнить и поставить в теплое темное место. Раз в день необходимо увлажнять почву с помощью пульверизатора. Через 10–15 дней можно наблюдать проростки и оценивать процент всхожести.l</p>\n<p align=\"center\">\n  <img src=\"https://portal.leafs.pro/web_images/gru.jpg\" />\n</p>\n<br />\n"', '"В связи с приближающимся сезоном выращивания рассады необходимо проверить семена на всхожесть. "', '2021-03-12 10:55:34.389403', false);
INSERT INTO public.articles (id, user_id, title, article_text, article_preview, insert_date, is_deleted) VALUES (13, 211, 'Лунный посевной календарь на Март 2021', '" <i>Лунный посевной календарь на Март 2021</i> <br />\n\n <div style=\"width:700px;margin-top:25px;background-color:#FFE4E1\"> \n <div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px;font-weight:bold\">Неблагоприятные дни для посадки и пересадки культур</div> </div> <div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">9,10,13</div>\n </div>\n\n <div style=\"width:700px;margin-top:25px;background-color:#F0FFF0\">\n    <div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px;font-weight:bold\">Культура</div> <div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px;font-weight:bold\">Благоприятные дни для посадки и пересадки культур</div></div> <div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Базилик, розмарин</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">22,23</div></div>\n    <div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Баклажаны, кабачки, патиссоны, тыква</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">22,23</div></div>\n    <div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Репа</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">1-4</div></div> <div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Дыня</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">22,23</div></div>\n    <div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Клубника, ревень</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">2-4</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Капуста, спаржа </div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">16-18</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\"> Картофель</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">1-5, 29-31</div></div>\n    <div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Лук на перо</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">14-15</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Лук на репку</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\"> 2-5, 30-31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Лук порей</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">14-15,19-23</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Морковь</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">1-4,29-31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Перец, томаты</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">22,23</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Подсолнечник, редька</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">22-25</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Редис</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">1-5, 29-31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Салат, шпинат</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">14-18</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Свекла</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">1-4, 11, 12, 29-31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Сельдерей</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">11-13, 16-18</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Укроп, фенхель</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">22-23,  26, 27</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Хмель</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">2-4, 21-23, 30, 31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Хрен</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">2-4, 30, 31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Цикорий</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">2-5, 22, 23, 30, 31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Чеснок</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">2-5, 30, 31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Цветы из луковиц</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">2-4, 30, 31</div></div><div style=\"display:flex;flex-direction:row\"><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">Цветы из семян</div><div style=\"flex-basis:100%;flex-shrink:1;padding:2px 0;margin:2px\">22-23, 26-27</div></div>\n</div>\n\n"', '"<i>Лунный посевной календарь на Март 2021</i>"', '2021-02-16 08:29:42.509035', true);
