 SELECT garden_planting.id,
    garden_planting.garden_id,
    garden_planting.garden_plant_id,
    garden_planting.planting_date,
    garden_planting.planting_size,
    garden_planting.planting_unit,
    garden_planting.harvesting_date,
    garden_planting.harvesting_size,
    garden_planting.harvesting_unit,
    garden_planting.description,
    garden_planting.is_deleted,
    garden_planting.insert_date
   FROM public.garden_planting
  WHERE (garden_planting.is_deleted = false);


ALTER TABLE public.v_garden_planting_active OWNER TO leafs;

