-- Name: v_garden_temporary_deleted; Type: VIEW; Schema: public; Owner: leafs
--

CREATE VIEW public.v_garden_temporary_deleted AS
 SELECT garden.id,
    garden.user_id,
    garden.name,
    garden.description,
    garden.temporary_deleted,
    garden.completely_deleted,
    garden.insert_date
   FROM public.garden
  WHERE ((garden.temporary_deleted = true) AND (garden.completely_deleted = false));


